import logo from './logo.svg';
import './App.css';

const App = () => {
  return (
    <>
      <div classname="App">
        <ul>
        <li>Sofi</li>
        <li>Hayk</li>
        <li>Ani</li>
      </ul>
      </div>
    </>
  );
}

export default App;
